page_settings.custom_css:
html,body{
overflow-x: hidden !important;
}

.m0{
margin: 0 !important;
}

.t_01 b{
color: #5BB0EF;
font-weight: 800;
}
.luz_text b{
text-shadow: #5a91cd 0px 0px 20px;
}

#efeito1:before{
content: '';
width: 80%;
height: 100%;
background: linear-gradient(#5786b3,transparent);
position: absolute;
left: 0;
right: 0;
margin: 0 auto;
top: -25px;
opacity: 0.4;
}

.shine1:before{
content: '';
width: 350px;
height: 350px;
background: #5786b3;
position: absolute;
left: -80px;
top: -80px;
opacity: 0.4;
filter: blur(80px);
border-radius: 50%;
z-index: 0;
}
.shine2:after{
content: '';
width: 350px;
height: 350px;
background: #5786b3;
position: absolute;
right: -80px;
bottom: -80px;
opacity: 0.3;
filter: blur(80px);
border-radius: 50%;
z-index: -0;
}


#slide .elementor-testimonial__name{
background: #5BB0EF;
position: absolute;
display: block;
width: 95%;
margin: 0 auto;
left: -15px;
right: 0;
bottom: 35px;
padding: 5px;
border-radius: 5px;
box-shadow: #17171754 1px 1px 5px;
}

#slide img{
border-radius: 5px;

width: 95%;
height: auto;
}

#sobre:before{
content: '';
width: 40%;
height: 300px;
background:linear-gradient(to right, #4e78d8,#2880c2,#74bcf1);
position: absolute;
left: 0;
top: 40%
}

#dores:before{
content: '';
width: 50%;
height: 200px;
background:linear-gradient(to right, #4e78d8,#2880c2,#74bcf1);
position: absolute;
right: 0;
top: 95px;
}


@media (max-width:768px){

.none{
display: none !important;
}
#efeito1:before{
display:none !important;
}
#sobre:before,#dores:before{
display: none !important;
}
}
